import React from "react";
import { Grid } from '@material-ui/core';
import "./stylesheet.css";
import Navbar from "./Navbar.js";
import DesignCo from "../assets/images/dco-logo.svg";
import Banner from "../assets/images/frontiers-banner.svg"

function Landing() {
  return (
    <div className="row">
      <div className="Landing">
      <div className="logo"></div>
      <Navbar></Navbar>
    </div>
    <div className="landing-container">
     <img src="{DesignCo}" alt="Design Co" className="bigimage"/>
    </div>
    
      
      
    <div className="row">
      <div className="landingtext">Design Frontiers is Design Coâ€™s annual design sprint where teams of creative, collaborative individuals tackle real problems in the world and design for innovation.</div>
    </div>
    
  </div>
  )
}

export default Landing;
